@stephencurry30 and @ayeshacurry attended the #MetGala2021 in #AtelierVersace.

@stephencurry30 wore a classic #AtelierVersace tuxedo embroidered with iconic Barocco shapes. The jacket is finished with a signature buckle inspired by Versace's bondage dress.

@ayeshacurry wore a custom #AtelierVersace gown inspired by extravagant American architecture. 
Together with her husband @stephencurry30, the couple represent the American dream and Hollywood glamour. The gown is adorned with signature Versace elements such as Medusa charms, Greca details and Barocco patterns. 

#VersaceCelebrities #StephenCurry #AyeshaCurry

@donatella_versace and @maluma arrive at the #MetGala2021 in #AtelierVersace.

@donatella_versace wears a gown inspired by Versace's iconic bondage dress, a look she first wore in New York in 1992. The voluminous silhouette references the work of prominent American designer Charles James.

@maluma wears a custom #AtelierVersace look inspired by American cowboys, a theme that has also served as inspiration for several of iconic Versace collections. The scarlet-red pieces are punctuated by signature Medusa studwork and marry Versace DNA with American fashion history.

